import 'dart:math';

class Solution {
  int maximumScore(List<int> nums, int k) {
    final int mod = 1000000007;
    List<int> scores = [];

    // Calculate prime scores for all numbers
    for (int num in nums) {
      scores.add(_primeScore(num));
    }

    // Sort numbers by their prime scores and values descendingly
    List<int> sortedIndexes = List.generate(nums.length, (i) => i);
    sortedIndexes.sort((a, b) => scores[b] != scores[a] ? scores[b].compareTo(scores[a]) : nums[b].compareTo(nums[a]));

    // Pick top k elements based on sorted order
    int result = 1;
    for (int i = 0; i < min(k, sortedIndexes.length); i++) {
      result = (result * nums[sortedIndexes[i]]) % mod;
    }

    return result;
  }

  int _primeScore(int n) {
    int score = 0;
    for (int i = 2; i <= sqrt(n); i++) {
      if (n % i == 0) {
        score++;
        while (n % i == 0) {
          n ~/= i;
        }
      }
    }
    if (n > 1) score++;
    return score;
  }
}
